column8:
●音の原因となるペーパーのバウンドをなくしたことで、<br>従来品に比べ音鳴を軽減しました。<br>
●ローラーの突起がペーパーを押さえ込み安定するため、<br>カッター部の雑音が出にくい構造になっています。<br>
●材質：亜鉛ダイキャスト＋ABS樹脂＋POM＋ステンレス<br>
●付属品：+なべタッピンねじφ4×30（SUS）2本、バネ座金2個<br>
●仕上：クローム＋鏡面（カバー）＋グレーローラー<br>
●耐荷重：49N（5kgｆ）<br>
※取付時に左差し変更可<br>
※トイレットペーパーの芯径がφ37～44.5を超えるものはご使用いただけません。<style type="text/css">
